import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import { Menu } from 'semantic-ui-react';
import Dossier from './Dossier';
import Example from './Example';
//import DisplayRemoteData from './DisplayRemoteData';
import './App.css';
import './Config';

export default class MenuExampleTabular extends Component {
  state = { activeItem: 'TEST DOSSIER'}

  handleItemClick = (e, { name }) => this.setState({ activeItem: name })
 render() {
  const { activeItem } = this.state

  function Index() {
     return (
        <Menu tabular>
         <div className="app">
             <Menu.Item name='TEST DOSSIER' active={activeItem === "/dossiers/teststorekey/testmodel/TEST"} onClick={this.handleItemClick} />
             <Link to="/dossiers/teststorekey/testmodel/TEST">TEST DOSSIER </Link>
             <Menu.Item name='TEST DOSSIER2' active={activeItem ==="/dossiers/teststorekey/testmodel/TEST2"} onClick={this.handleItemClick} />
             <Link to="/dossiers/teststorekey/testmodel/TEST2">TEST DOSSIER2</Link>
         </div>
        </Menu> 
     );
  }
 }
}

function DossierIndex( { match }) {
    console.log(match.params);
    return (
        <div className="app">
            <Index/>
            <Dossier dossierKey={match.params.dossierKey} dossierPackage={match.params.dossierPackage} dossierCode={match.params.dossierCode}/>
        </div>
    );
}

class App extends Component {
    render() {
        return (
            <Router>
                <div>
                    <Route path="/" exact component={Index} />
                    <Route path="/dossiers/:dossierKey/:dossierPackage/:dossierCode" component={DossierIndex} />
                </div>
            </Router>
        );
    }
}

//export default App;
